    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then                                 U.S. Census Bureau's Master Address File
    / Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
    (MTDB).n                                 The MTDB represents a seamless national
    file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed ton                                 stand alone as an independent data
    set, or they can be combined to cover the entire nation.nn                                 The
    Coastline Shapefile includes all features within the MTDB Class "Coastline" distinguished
    where the MAF/TIGER Featuren                                 Classification Code
    (MTFCC) for the feature in MTDB is L4150. The coastline included in this shapefile
    was delineated by the Censusn                                 Bureau in the MAF/TIGER
    database based on water measurement class for display of statistical information
    only; its depiction andn                                 designation for statistical
    purposes does not constitute a determination of jurisdictional authority or rights
    of ownership orn                                 entitlement and it is not a legal
    land description. This shapefile should be used for data presentation purposes only.
     It is not then                                 official source for the coastline
    feature. The name assigned to each Coastline feature is a short form of the name
    of the large body ofn                                 water bordered by this Coastline
